import axios from "axios";

// let token = localStorage.getItem('token');
let token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJyZXN1bHQiOnsiaWRVc2VyIjoyNSwidXNlcm5hbWUiOiJ1c2VycyJ9LCJpYXQiOjE2NzQ1NDU5NDIsImV4cCI6MTY3NDU1MzE0Mn0.C70DFgHdwFmo8U_iaVxWWY6jhCKoHEsdANjHu0i3G-k";

export default axios.create({
    baseURL: "http://localhost:3000",
    headers: {
        'Content-Type': 'application/json',
        'Authorization': token
    },
})
